import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import "../assets/css/master.css";

import Navigation from "./components/navbar.component";

function App() {
  return (
    <Switch>
      <Route exact path="/">
        <Navigation />
      </Route>
    </Switch>
  );
}

export default App;
